const redisClient = require('../utils/redis');
const dbClient = require('../utils/db');
const { v4: uuidv4 } = require('uuid');
const { pwdHashed } = require('../utils');

const AuthController = {
  async getConnect(req, res) {
    const authHeader = req.headers['authorization'];

    if (!authHeader) {
      return res.status(401).json({ error: 'Unauthorized' });
    }

    // Extract email and password from Basic Auth header
    const authCredentials = Buffer.from(authHeader.split(' ')[1], 'base64').toString().split(':');
    const email = authCredentials[0];
    const password = authCredentials[1];
    const hashedPassword = pwdHashed(password); // Assuming pwdHashed is a function to hash the password

    // Find the user based on email and hashed password
    const user = await dbClient.getUser(email);

    if (!user || user.password !== hashedPassword) {
      return res.status(401).json({ error: 'Unauthorized' });
    }

    // Generate a random token
    const token = uuidv4();

    // Store the user ID in Redis with the token as the key for 24 hours
    await redisClient.set(`auth_${token}`, user._id.toString(), 24 * 60 * 60);

    // Return the token
    res.status(200).json({ token });
  },

  async getDisconnect(req, res) {
    const { 'x-token': token } = req.headers;

    if (!token) {
      return res.status(401).json({ error: 'Unauthorized' });
    }

    // Retrieve the user based on the token
    const userId = await redisClient.get(`auth_${token}`);

    if (!userId) {
      return res.status(401).json({ error: 'Unauthorized' });
    }

    // Delete the token from Redis
    await redisClient.del(`auth_${token}`);

    // Return success with no content (status code 204)
    res.status(204).send();
  },
};

module.exports = AuthController;

